import React from "react";
import "./product.css";
import Rating from '@mui/material/Rating';

const Product = () => {
    return (
    <div className="productThumb">
        <div className="imgWrapper">
            <img src="https://www.pngwing.com/en/free-png-tqtin" alt="" className="w-100"/>
        </div>
        <div className="info">
            <div className="d-blo">Product Name</div>
            <div className="price">Price</div>
        </div>
       </div>
    )
};

export default Product;
